import React from 'react';
import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Form, Button} from "react-bootstrap";
import Axios from "axios";

function App() {

  const headUrl: string = 'http://localhost:8080/';

  function submitLoginInfo (username : string, password : string) : void{
    const addUserUrl = `${headUrl}account/add`
    try {
      Axios.post(addUserUrl, {
        username: username,
        password: password,
      })
          .then(function (response) {
            console.log(response);
          })
    } catch (exception) {
      process.stderr.write(`ERROR received from ${addUserUrl}: ${exception}\n`);
    }
  };



  return (
    <div className="App">
      <header className="App-header">
        <Form>
          <Form.Group controlId="formBasicEmail">
            <Form.Label>Email address</Form.Label>
            <Form.Control type="emailn" placeholder="Enter email" />
            <Form.Text className="text-muted">
              We'll never share your email with anyone else.
            </Form.Text>
          </Form.Group>

          <Form.Group controlId="formBasicPassword">
            <Form.Label>Password</Form.Label>
            <Form.Control type="password" placeholder="Password" />
          </Form.Group>
          <Form.Group controlId="formBasicCheckbox">
            <Form.Check type="checkbox" label="Check me out" />
          </Form.Group>
          <Button variant="primary" type="submit">
            Submit
          </Button>
        </Form>
      </header>
    </div>
  );
}

export default App;
